pragma solidity 0.7.4;

import "./ERC1155Tradable.sol";

/**
 * @title ERC1155
 * ERC1155 - a contract for ERC1155 semi-fungible tokens.
 */
contract hashartERC1155 is ERC1155Tradable {
    constructor(address _proxyRegistryAddress)
        public
        ERC1155Tradable(
            "HashArt Generator ERC1155",
            "HAG",
            _proxyRegistryAddress    // rinkeby = 0xf57b2c51ded3a29e6891aba85459d600256cf317
                                     // mainnet = 0xa5409ec958c83c3f309868babaca7c86dcb077c1
        )
    {
        _setBaseMetadataURI("https://api.hashable.art/token/");
    }

    function contractURI() public pure returns (string memory) {
        return "https://api.hashable.art/contract/hashart-erc1155";
    }
}
